import React from "react";

const Task = (props) => {

    const manageTask = () =>{
        manageTaskHandler();
    }

  return (
    <tr onClick={manageTask}>
      <td>{props.id}</td>
      <td>{props.projectName}</td>
      <td>{props.taskName}</td>
      <td>{props.status}</td>
    </tr>
  );
};

export default Task;
